contracts/PIDR_test.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract PIDR_test {

    uint seed = 0;
    uint salePrice = 0.01 ether;

    modifier ownerOnly() {
        require(msg.sender == artwork.owner);
        _;
    }

    struct Artwork {
        uint idArtwork;
        address owner;
    }

    Artwork private artwork;

    function _generateRandom() private returns (uint) {
        uint rand = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, seed)));
        seed ++;
        return rand;
    }

    function _changeID() private {
        artwork.idArtwork = _generateRandom();
    }

    function changeOwner(address _newOwner) external payable ownerOnly {
        require(msg.value == salePrice);
        artwork.owner = _newOwner;
        _changeID();
    }

    function getIdArtwork() external view returns(uint) {
        return artwork.idArtwork;
    }

    function getOwner() external view returns(address) {
        return artwork.owner;
    }

}

